import React, { useState, useEffect } from "react";
import { fetchDailyData } from "../../api"

const chart = () => {
    const [ dailyData, setDailyData ] = useState({});

    useEffect(() => {
        const fetchedData = async () => {
            return fetchDailyData()
        }

    }, []) 

    return(
        <h1>Chart</h1>
    )
}

export default chart;
